(2907, 1, 'en', 'labels', 'backend.update.warning', '<b>WARNING : We strongly recommend you to update theme by version number</b>.<br> <b>Example :</b> update_v1.zip, update_v2.zip. Please do not jump version number. If your version number is 1 and you want to update it, then update to version 2. Do no directly update to version 3.', '2020-12-14 04:58:36', '2020-12-14 04:58:36'),
(2908, 1, 'en', 'labels', 'backend.update.note_before_upload', '<p><b>Please take BACKUP before updating.</b> Updated zip file may come with new folders and file updates. <b>Your current files will be replaced with new one</b>. So, <b>if you have made any changes in current application files it will be LOST</b>.</p>\n                        <p>If you are directly uploading from below file input box, your files will be replaced. We strongly recommend you to do it manual replacement of files one by one or edit the changes by comparing your current edited file and new updated files.</p>\n                        <p>If you still have confusion. Please contact us, we will guide you to update your application</p>', '2020-12-14 04:58:36', '2020-12-14 04:58:36'),
