(4778, 1, 'es', 'labels', 'backend.general_settings.contact.map_note', '<h3> Cmo incrustar la ubicacin para el mapa? </h3>\n<p> Sigue los sencillos pasos y ya ests listo: </p>\n<ol class = \"map-guide\">\n<li> Vaya a <a class=\"text-bold\" target=\"_blank\" href=\"//maps.google.com\"> Mapa de Google </a> </li>\n<li> Busque el lugar que desea agregar ingresando la direccin / ubicacin en el cuadro de entrada ubicado en la esquina superior izquierda </li>\n<li> Una vez que obtenga el lugar que desea. Muestra detalles en la barra lateral izquierda. Haga clic en el botn <i class = \"fa fa-share-alt text-primary\"> </i> </li>\n<li> Aparecer una ventana emergente que tendr dos pestaas <b> Enviar un enlace </b> y <b> Incrustar un mapa </b> </li>\n<li> Haga clic en <b> Insertar un mapa </b>. Le mostrar el lugar que ha elegido en el mapa </li>\n<li> Ahora haga clic en el men desplegable de la izquierda. De forma predeterminada, se selecciona <b> Medio </b>. Haga clic en l y seleccione <b> Large</b> </li>\n<li> Ahora haga clic en el enlace <b class = \"text-primary\"> COPY HTML </b> y <b> Pegar </b> ese cdigo aqu en <b> Ubicacin en el mapa </b>. < /li>\n</ol>', '2020-12-14 04:58:49', '2020-12-14 04:58:49'),
