(5143, 1, 'es', 'labels', 'backend.update.note_before_upload', '<p> <b> Realice BACKUP antes de actualizar. </b> El archivo zip actualizado puede incluir nuevas carpetas y actualizaciones de archivos. <b> Sus archivos actuales sern reemplazados por uno nuevo </b>. Por lo tanto, <b> si ha realizado algn cambio en los archivos de la aplicacin actual, se PERDER </b>. </p>\n <p> Si est cargando directamente desde el cuadro de entrada de archivo inferior, sus archivos sern reemplazados. Le recomendamos encarecidamente que realice la sustitucin manual de los archivos uno por uno o edite los cambios comparando su archivo editado actual y los nuevos archivos actualizados. </p>\n <p> Si todava tienes confusin. Pngase en contacto con nosotros, le guiaremos para actualizar su aplicacin </p>', '2020-12-14 04:58:52', '2020-12-14 04:58:52'),
