(6853, 1, 'fr', 'labels', 'backend.general_settings.contact.map_note', '<h3> Comment intgrer l\'emplacement pour la carte? </h3>\n<p> Suivez les tapes simples ci-dessous et vous tes prt  partir: </p>\n<ol class = \"map-guide\">\n<li> Accdez  la <a class=\"text-bold\" target=\"_blank\" href=\"//maps.google.com\"> carte Google </a> </li>.\n<li> Recherchez le lieu que vous souhaitez ajouter en saisissant l\'adresse dans la zone de saisie situe dans le coin suprieur gauche </li>\n<li> Une fois que vous avez trouv l\'endroit que vous voulez. Il montre les dtails dans la barre latrale gauche. Cliquez sur le bouton <i class = \"fa fa-share-alt text-primary\"> </i> </li>\n<li> Une fentre contextuelle contenant deux onglets apparatra <b> Envoyer un lien </b> et <b> Intgrer une carte </b> </li>\n<li> Cliquez sur <b> Intgrer une carte </b>. Il vous montrera l\'emplacement choisi sur la carte </li>.\n<li> Cliquez maintenant sur le menu droulant  gauche. Par dfaut, <b> Moyen </b> est slectionn. Cliquez dessus et slectionnez <b> Grand </b> </li>\n<li> Maintenant, cliquez sur le lien <b class = \"text-primary\"> COPY HTML </b> et sur <b> Collez </b> ce code ici dans <b> Emplacement sur la carte </b>. </li>\n</ol>', '2020-12-14 04:59:09', '2020-12-14 04:59:09'),
